What an inspiring group of ladies! All authors and you know what a lot of us experienced? Self doubt. It seemed so hard to imagine that such wonderful writers with a wealth of experience behind them could feel that way, but as I sat there with them having drinks before the event most of us talked about grappling with our inner critic. So if you have the desire to write but think you're not good enough... Pick up a pen and just see what comes out of it. Challenge your inner critic and ask... what if?
